import {Link} from 'react-router-dom';
import 'tachyons';

const SubStyle = 
{
  color: "#fec503"
}

const Admin = 
{

}

class BreastCancer extends Component 
{
    render()
    {
        return (
          <div>
            <h1 className="tc  f1 lh-title" style={SubStyle}>
              BREAST CANCER
            </h1>
            <div className="dib col-xl-3 col-sm-6 mb-5">
              <Link to="#">
                <div className="bg-white rounded shadow-sm py-5 px-4 tc">
                  <h1 className="mb-0" style={Admin}>
                    <input type="file"></input>
                  </h1>
                </div>
              </Link>
            </div>
          </div>
        );
    }
}

export default BreastCancer;
